import { Link } from "react-router-dom"
import Cart from "./Cart"
import "./nav.css"
import { useEffect, useState } from "react";
import { FaBeer,FaBars} from "react-icons/fa";
import {IconContext} from "react-icons"
function Nav(props){

const [no,setno] = useState("")
useEffect(()=>{
const localno = localStorage.getItem('cartdata');

  if(localno){const a = JSON.parse(localno);

     setno(a.length)}


},[])

return(
    <>
     <div className="nav"> 

     <p className="logo">HONEY BOBA</p>
     <IconContext.Provider value={{ className: 'r' }}>
     <FaBeer/>
     <FaBars/>
     </IconContext.Provider>

     <Link  to ={{pathname:"/cart"}}><div className="cartcon"><div className="cartno">{no || ""}</div><img className="cartimg" src="/cart.jpg"></img></div></Link>




     </div>
    </>
)
}
export default Nav;
